import React from 'react'
import  { useState } from 'react';
import { BsFillHouseFill } from "react-icons/bs";
import { BsFillPersonFill } from "react-icons/bs";
import { BsFillChatLeftDotsFill } from "react-icons/bs";
// import { BsSearch } from "react-icons/bs";
import { AiOutlineClose } from "react-icons/ai"
import Modal from 'react-responsive-modal'
function Navbar() {
     const [isModalOpen, setIsModalOpen] = useState(false)
     const Close =(<AiOutlineClose />)
    return (
        <div className='Header'>
            <div className='Headlogo'>
                <div className='Icons'>
                    <div className='Icon'>
                    {/* <BsFillHouseFill size='28px'/> */}

                    </div>
                    <div className='Icon'>
                    {/* <BsFillPersonFill size='28px' /> */}

                    </div>
                    <div className='Icon'>
                    {/* <BsFillChatLeftDotsFill size='28px' /> */}

                    </div>
                    <div className='Icon'>
                    {/* <RiChat4Fill size='28px' /> */}

                    </div>
                    <div className='Search'>
                    {/* <BsSearch /> */}
                        
                        <input placeholder='Search CoderBeings'></input>
                    </div>
                    <div className='Btn'>
                        <button>Ask a Question</button>
                        <Modal
                        open = {isModalOpen} AiOutlineClose={Close}>
                            
                            <div className='modal-title'>
                                This is test

                            </div>
                        </Modal>
                    </div>
                </div>

            </div>
            
        </div>
       
    )
}

export default Navbar
